{/* <button type="button" class="btn btn-outline-info">Info</button> */}
export default class Channels extends React.Component {
    render() {
        return (
            <div>
                <button type="button" class="btn btn-outline-info">Ant1</button>
                <button type="button" class="btn btn-outline-info">Alpha</button>
                <button type="button" class="btn btn-outline-info">Mega</button>
                <button type="button" class="btn btn-outline-info">Star</button>
                <button type="button" class="btn btn-outline-info">Skai</button>
                <button type="button" class="btn btn-outline-info">Ert1</button>
                <button type="button" class="btn btn-outline-info">Ert2</button>
                <button type="button" class="btn btn-outline-info">Ert3</button>
            </div>
        )
    }
}
